pragma solidity ^0.4.19;

contract Gapless {

    struct CarOwnership {
        bytes32 userDataHash;
        bytes32[] userDocumentHashes;
        bytes32 carDataHash;
        bytes32[] carDocumentHashes;
    }

    mapping(bytes32 => string) internal hashLinkResolver;

    mapping(address => int) internal userToCarOwnershipMapping;

    CarOwnership[] internal carOwnerships;

    //hashLinkResolver["43C1C01651EB3D64219208F8CBDFBDF09F503F436FF650925AAE5C6B43BABCFC"] = "https://www.tu-berlin.de/fileadmin/fg38/funktionsuebersicht/beispiel.pdf";
    //hashLinkResolver["03B687465E782034EE608A3EDB63AA05CD919FD84CBE41C1E7D9C055B24D3168"] = "https://www.einfach-fuer-alle.de/artikel/checkliste-barrierefreie-pdf/Checkliste-Barrierefreies-PDF.pdf";

    function createCarOwnership(bytes32 _userDataHash, bytes32 _carDataHash) public {
        // one user can have only one car ownership
        int carOwnershipId = userToCarOwnershipMapping[msg.sender];
        require(carOwnershipId == 0);

        CarOwnership memory carOwnership;

        carOwnership.userDataHash = _userDataHash;
        carOwnership.carDataHash = _carDataHash;
        carOwnershipId = int(carOwnerships.push(carOwnership));
        userToCarOwnershipMapping[msg.sender] = int(carOwnershipId);
    }

    function appendUserDocument(bytes32 _userDocumentHash, string _userDocumentURL) public {
        // Verify if car ownership exists
        int carOwnershipId = userToCarOwnershipMapping[msg.sender];
        require(carOwnershipId > 0);
        // -1 because of array indices
        carOwnerships[uint(carOwnershipId) - 1].userDocumentHashes.push(_userDocumentHash);
        hashLinkResolver[_userDocumentHash] = _userDocumentURL;
    }

    function exerciseRightToBeForgotten() public {
        // Verify if car ownership exists
        int carOwnershipId = userToCarOwnershipMapping[msg.sender];
        require(carOwnershipId > 0);

        userToCarOwnershipMapping[msg.sender] = - 1;
    }

    function getCarOwnership() public view returns (bytes32, bytes32) {
        // Verify if car ownership exists
        int carOwnershipId = userToCarOwnershipMapping[msg.sender];
        require(carOwnershipId > 0);

        return (carOwnerships[uint(carOwnershipId) - 1].userDataHash, carOwnerships[uint(carOwnershipId) - 1].carDataHash);
    }

    struct ValueReportRequestResponse {
        address requestReceiver;
        address requesterUserId;
        bytes32 userDataHash;
        bytes32[] userDocumentHashes;
        bytes32 carDataHash;
        bytes32[] carDocumentHashes;
        bytes32[] userGeneratedCarPictureHashes;
        bytes32 userGeneratedSelfAssessmentAnswersHash;
        bytes32 reportProviderResponse;
    }

    mapping(string => string) internal userGeneratedCarPictures;
    mapping(string => string) internal userGeneratedSelfAssessmentAnswers;
    mapping(string => string) internal reportProviderResponses;

    ValueReportRequestResponse[] internal valueReportRequestResponses;
}
